import React from "react";
import ReactDOM from 'react-dom';
import './index.css'
import  App  from "./App";
import{add,subtract,multiply,division} from "./Calc"
 ReactDOM.render(<>
 <ul>
    <li>{add(5,4)}</li>
    <li>{subtract(44,11)}</li>
    <li>{multiply(37,23)}</li>
    <li>{division(45,4)}</li>
    </ul></>,
    document.getElementById('root'));
